import * as React from "react";

class Header extends React.Component {
    render() {
        return <header id="header" className="alt">
            <div className="logo"><a href="/">Boutique<span>Air France</span></a></div>
            <a href="#menu">Menu</a>
        </header>;
    }
}

export default Header;
